  "notes": "*The initial cast counts as an ability activation for the purposes of on-cast effects such as <span class=\"glossary\" data-tip=\"Spellblade\" style=\"white-space:pre; position:relative;\" data-game=\"lol\"><a href=\"/wiki/Named_item_effect#Spellblade\" title=\"Named item effect\"><img height=\"20\" data-relevant=\"0\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/c/c6/Sheen_item.png/revision/latest/scale-to-width-down/20?cb=20201118210052\" data-image-name=\"Sheen item.png\" data-image-key=\"Sheen_item.png\" alt=\"Sheen item\" width=\"20\" loading=\"lazy\" decoding=\"async\" class=\"lazyload\"></a> <a href=\"/wiki/Named_item_effect#Spellblade\" title=\"Named item effect\">Spellblade</a></span> and triggering <span data-champion=\"Kassadin\" data-ability=\"Force Pulse\" data-param=\"\" data-game=\"lol\" style=\"display:inline;white-space:pre;\" class=\"inline-image label-after ability-icon\"><span style=\"display:inline-block;position:relative;\" class=\"border\" data-width=\"20\"><a href=\"/wiki/Kassadin/LoL#Force_Pulse\" title=\"Force Pulse's\"><img data-relevant=\"0\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" height=\"20\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/2/22/Kassadin_Force_Pulse.png/revision/latest/scale-to-width-down/20?cb=20170818190412\" data-image-name=\"Kassadin Force Pulse.png\" width=\"20\" alt=\"Force Pulse's\" data-image-key=\"Kassadin_Force_Pulse.png\" class=\"thumbborder lazyload\" decoding=\"async\" loading=\"lazy\"></a></span> <span style=\"white-space:normal;\"><a title=\"Kassadin/LoL\" href=\"/wiki/Kassadin/LoL#Force_Pulse\">Force Pulse's</a></span></span> passive.\n<ul><li><ul><li>Recasting the ability does not.</li></ul></li>\n<li>The first card shown is random but the order always remains the same (<span data-game=\"lol\" class=\"inline-image label-after ability-icon\" data-champion=\"Twisted Fate\" style=\"display:inline;white-space:pre;\" data-param=\"\" data-ability=\"Blue Card\"><span data-width=\"20\" class=\"border\" style=\"display:inline-block;position:relative;\"><a href=\"/wiki/Twisted_Fate/LoL#Blue_Card\" title=\"Blue Card\"><img alt=\"Blue Card\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" width=\"20\" decoding=\"async\" data-relevant=\"0\" loading=\"lazy\" height=\"20\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/4/4d/Twisted_Fate_Blue_Card.png/revision/latest/scale-to-width-down/20?cb=20171221051418\" class=\"thumbborder lazyload\" data-image-name=\"Twisted Fate Blue Card.png\" data-image-key=\"Twisted_Fate_Blue_Card.png\"></a></span> <span style=\"white-space:normal;\"><a href=\"/wiki/Twisted_Fate/LoL#Blue_Card\" title=\"Twisted Fate/LoL\">Blue Card</a></span></span>, <span data-game=\"lol\" style=\"display:inline;white-space:pre;\" class=\"inline-image label-after ability-icon\" data-param=\"\" data-champion=\"Twisted Fate\" data-ability=\"Red Card\"><span style=\"display:inline-block;position:relative;\" class=\"border\" data-width=\"20\"><a href=\"/wiki/Twisted_Fate/LoL#Red_Card\" title=\"Red Card\"><img data-image-key=\"Twisted_Fate_Red_Card.png\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/8/8b/Twisted_Fate_Red_Card.png/revision/latest/scale-to-width-down/20?cb=20171221051531\" class=\"thumbborder lazyload\" height=\"20\" data-image-name=\"Twisted Fate Red Card.png\" alt=\"Red Card\" loading=\"lazy\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" width=\"20\" data-relevant=\"0\" decoding=\"async\"></a></span> <span style=\"white-space:normal;\"><a href=\"/wiki/Twisted_Fate/LoL#Red_Card\" title=\"Twisted Fate/LoL\">Red Card</a></span></span>, <span data-param=\"\" style=\"display:inline;white-space:pre;\" data-champion=\"Twisted Fate\" data-ability=\"Gold Card\" data-game=\"lol\" class=\"inline-image label-after ability-icon\"><span data-width=\"20\" class=\"border\" style=\"display:inline-block;position:relative;\"><a title=\"Gold Card\" href=\"/wiki/Twisted_Fate/LoL#Gold_Card\"><img loading=\"lazy\" height=\"20\" data-image-name=\"Twisted Fate Gold Card.png\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/4/4a/Twisted_Fate_Gold_Card.png/revision/latest/scale-to-width-down/20?cb=20171221051432\" alt=\"Gold Card\" width=\"20\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" class=\"thumbborder lazyload\" data-image-key=\"Twisted_Fate_Gold_Card.png\" decoding=\"async\" data-relevant=\"0\"></a></span> <span style=\"white-space:normal;\"><a title=\"Twisted Fate/LoL\" href=\"/wiki/Twisted_Fate/LoL#Gold_Card\">Gold Card</a></span></span>, repeat).\n<ul><li>Upon activation, an indicator visible to allies and enemies appears above <b>Twisted Fate</b> to show him shuffling his deck of cards while remaining in the same order, the card he can choose at every moment glows over the others. The selected card is specified for the duration of the enhanced attack.</li></ul></li>\n<li><span title=\"Pending for test\" style=\"color:red; font-family:math; font-weight:bold; font-size:1em;\"><span class=\"fas fa-vial\"></span> PENDING FOR TEST:</span> The interval until the next card is hovered is <span style=\"border-bottom:1px dotted gray;cursor:help;\" title=\"0.5 seconds, but rounded up to the next game tick.\" class=\"basic-tooltip\">0.<small>528</small> seconds</span> every time, instead of some times 0.<small>528</small> and other times 0.<small>495</small>.</li>\n<li>If the target becomes <span class=\"glossary\" data-tip=\"Untargetable\" data-game=\"lol\" style=\"white-space:pre; position:relative;\"><a title=\"Untargetable\" href=\"/wiki/Untargetable\"><img loading=\"lazy\" width=\"20\" data-image-name=\"Untargetable icon.png\" class=\"lazyload\" alt=\"Untargetable icon\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/4/41/Untargetable_icon.png/revision/latest/scale-to-width-down/20?cb=20220206063243\" decoding=\"async\" height=\"20\" data-image-key=\"Untargetable_icon.png\" data-relevant=\"0\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\"></a> <a title=\"Untargetable\" href=\"/wiki/Untargetable\" class=\"mw-redirect\">untargetable</a></span>, <span data-tip=\"Death\" class=\"glossary\" data-game=\"lol\" style=\"white-space:pre; position:relative;\"><a title=\"Death\" href=\"/wiki/Death\"><img height=\"20\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/c/c3/Death.png/revision/latest/scale-to-width-down/20?cb=20200415031113\" class=\"lazyload\" data-image-name=\"Death.png\" loading=\"lazy\" data-image-key=\"Death.png\" data-relevant=\"0\" alt=\"Death\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" decoding=\"async\" width=\"20\"></a> <a href=\"/wiki/Death\" title=\"Death\">dies</a></span>, or is too far away during the empowered attack's cast time, it is cancelled but not consumed.</li>\n<li>The empowered attack will trigger against <a title=\"Structures\" href=\"/wiki/Structures\" class=\"mw-redirect\">structures</a> and <a class=\"mw-redirect\" title=\"Buildings\" href=\"/wiki/Buildings\">buildings</a> but not <a title=\"Ward\" href=\"/wiki/Ward\">wards</a>.</li></ul>",
